import React from 'react';
import BestPracticeCard from './BestPracticeCard';
import { bestPractices } from '../data/bestPractices';

function BestPracticeList() {
  return (
    <div style={{display: 'flex', overflowX: 'auto', padding: '16px'}}>
      {bestPractices.map((practice, idx) => (
        <BestPracticeCard key={idx} {...practice} />
      ))}
    </div>
  );
}

export default BestPracticeList;
